import React, { useState } from 'react'
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import IconButton from '@mui/material/IconButton';
import MenuIcon from '@mui/icons-material/Menu';
import { useTheme } from "@mui/material/styles";
import { Container } from '@mui/system';


const Navbar = () => {
    const theme = useTheme();
    const primaryColor = theme.palette.primary.main;

  return (
    <Box sx={{ flexGrow: 1 }}>
      <AppBar position="static" sx={{backgroundColor: 'white', color:primaryColor}}>
        <Toolbar>
          <IconButton
            size="large"
            edge="start"
            color="inherit"
            aria-label="menu"
            sx={{ flexGrow: 1, mr: 2 }}
          >
            <MenuIcon />

            <Box
          component='img' 
          src='./logosoup.svg'
          width='53px'
          height='50px'
          sx={{ 
            ml: '60px'
            }}/>
          </IconButton>


          <Box
          sx={{
            display: 'flex',
            flexDirection: 'row',
            gap: '40px',
            mr: '50px'
          }}>
            <Button 
              color="inherit"
              sx={{
                width: '175px',
                height: '40px',
                border: '1px solid #5B4947',
                borderRadius: '8px',
              }}>
                Login
                </Button>
            <Button 
              variant="contained"
              color="secondary"
              sx={{
                width: '175px',
                height: '40px',
                borderRadius: '8px',
                color: primaryColor
              }}>
                Register
                </Button>
          </Box>

        </Toolbar>
      </AppBar>
    </Box>
  );
}

export default Navbar;
